import React from "react";
import { useState } from "react";
import Secondcard from "./Secondcard";

function App() {
  const data = [
    {
      name: "aditya",
      profession: "sde",
      image:
        "https://images.unsplash.com/photo-1506794778202-cad84cf45f1d?q=80&w=1974&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
      friends: true,
    },
    {
      name: "sunny",
      profession: "mangta",
      image:
        "https://images.unsplash.com/photo-1503443207922-dff7d543fd0e?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Nnx8bWVuc3xlbnwwfHwwfHx8MA%3D%3D",
      friends: false,
    },
    {
      name: "chomu",
      profession: "berozgar",
      image:
        "https://images.unsplash.com/photo-1480455624313-e29b44bbfde1?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTF8fG1lbnN8ZW58MHx8MHx8fDA%3D",
      friends: false,
    },
  ];
  const [realdata, setrealdata] = useState(data);
  const dummy = () => alert("hey");

  return (
    <>
      <div className="w-full h-screen bg-zinc-300 flex gap-4 items-center justify-center">
        {realdata.map((item, index) => (
          <Secondcard
            key={index}
            image={item.image}
            name={item.name}
            profession={item.profession}
            dummy={dummy}
          />
        ))}
      </div>
    </>
  );
}

export default App;
